import {ICrudPersonRepository} from "./ICrudRepository";
import {Person} from "../domain/Person";
import {ENDPOINT} from "../util/Contants";
import $ = require("jquery");
import {PersonDTO} from "../dto/PersonDTO";

export class PersonRepository implements ICrudPersonRepository<Person, number> {

    // @ts-ignore
    findAll(): Person[] {
        let p: Person[] = [];
        // @ts-ignore
        $.ajax({
            url: ENDPOINT.persons.list,
            method: 'GET',
            async: false,
            success: (data, any) => {
                alert("OK");
                $.extend(p, data);
            },
            error: (msg) => {
                console.log(msg);
            }
        })
        return p;
    }

    findOne(id: number): Person {
        // let id = $(location).attr(`href`).split("/")[3];
        // @ts-ignore
        let person: Person = new Person();
        $.ajax({
            url: ENDPOINT.person + `${id}`,
            method: 'GET',
            async: false,
            success: (data, any) => {
                $.extend(person, data);
            },
            error: jqXHR => console.log(jqXHR)
        })
        return person;
    }

    save(person: Person) {
        $.ajax({
            url: ENDPOINT.save,
            method: 'POST',
            async: false,
            contentType: 'application/json',
            data: JSON.stringify(person),
            success: (data, any) => {
                alert("Thêm mới thành công");
            },
            error: jqXHR => alert("Thêm mới không thành công")
        })
        return person;
    }

    findByNameAndStatus(name: string = "", status: string = "ALL") {
        // let persons : Person = new Person(null, null, null, null, null);
        let persons : PersonDTO[] = [];
        $.ajax({
            url: ENDPOINT.findByNameAndStatus + `?name=${name}${status == "ALL" ? "" : "&status=" + status}`,
            method: 'GET',
            async: false,
            contentType: "application/json",
            // data : JSON.stringify({
            //     name,
            //     status
            // }),
            success: data => {
                $.extend(persons, data)
            },
            error: jqXHR => {
                alert("none");
            }
        })
        return persons;
    }
}
